import st1img from"./images/4.gif";
import nd2img from"./images/1.jpg";
import rd3img from "./images"
const images = [{
    id: 1,
    src: st1img,
    alt: "Image 1 not found"
},
{
    id: 2,
    src: nd2img,
    alt: "Image 2 not found"
},
{
    id: 3,
    src: "images/3.jpg",
    alt: "Image 3 not found"
}
];
export default images;
